import javax.swing.JFileChooser;
import javax.swing.filechooser.FileNameExtensionFilter;


public class File_Creator {
	
	private static List<Byte> result = new ArrayList<>();
	
	public static void main(String[] args) {
		result.addAll(convertHexStringToBytes(Data.PREFIX));
        doWork();
        result.addAll(convertHexStringToBytes(Data.Suffix));
        System.out.println(result.size());
        createFile();
	}
	
	private static void createFile() {
	    // Convert List<Byte> to byte array
	    byte[] bytesArray = new byte[result.size()];
	    for (int i = 0; i < result.size(); i++) {
	        bytesArray[i] = result.get(i);
	    }

	    // Create a JFileChooser instance
	    JFileChooser fileChooser = new JFileChooser();
	    fileChooser.setDialogTitle("Select Save Location");
	    
	    FileNameExtensionFilter filter = new FileNameExtensionFilter("CPF Files", "cpf");
	    fileChooser.setFileFilter(filter);

	    // Show save dialog to user
	    int userSelection = fileChooser.showSaveDialog(null);

	    if (userSelection == JFileChooser.APPROVE_OPTION) {
	        File fileToSave = fileChooser.getSelectedFile();

	        // Ensure the file has a ".bin" extension
	        if (!fileToSave.getAbsolutePath().endsWith(".cpf")) {
	            fileToSave = new File(fileToSave + ".cpf");
	        }

	        // Write the byte array to the selected file
	        try (BufferedOutputStream bos = new BufferedOutputStream(new FileOutputStream(fileToSave))) {
	            bos.write(bytesArray);
	            System.out.println("File written successfully to: " + fileToSave.getAbsolutePath());
	        } catch (IOException e) {
	            System.err.println("An error occurred while writing the file: " + e.getMessage());
	        }
	    } else {
	        System.out.println("Save command cancelled by user.");
	    }
	}
	
	private static void doWork() {
		JFileChooser fileChooser = new JFileChooser();
        int result = fileChooser.showOpenDialog(null);
        if (result == JFileChooser.APPROVE_OPTION) {
            File selectedFile = fileChooser.getSelectedFile();
            readFileContent(selectedFile);
        }
	}
	private static void readFileContent(File file) {
        StringBuilder contentBuilder = new StringBuilder();
        try (BufferedReader br = new BufferedReader(new FileReader(file))) {
            String currentLine;

            boolean isFlag = false;
            String blockFlag = "";
            
            while ((currentLine = br.readLine()) != null) {
            	if(isFlag && currentLine.contains(blockFlag)) {
            		isFlag = false;
            		blockFlag = "";
            		if(contentBuilder.toString().length() > 0)
            			processBlock(contentBuilder.toString());
            		contentBuilder = new StringBuilder();
            		continue;
            	}
            	
            	if(!isFlag && currentLine.length() > 0) {
            		blockFlag = currentLine.substring(1, currentLine.length() -1);
            		isFlag = true;
            	}

            	if(!blockFlag.equals("Comment") && currentLine.length() > 0) {
            		contentBuilder.append(currentLine).append("\n");
            	}            	
            }
        } catch (IOException e) {
            e.printStackTrace();
        }
    }
	
	private static void processBlock(String block) {
		Map<String, String> blockMap = parseBlockToMap(block);
		List<Byte> tmp = new ArrayList<>();
		
		byte[] decodedBytes = Base64.getDecoder().decode(blockMap.get("Unit_Block_Head"));

	    for (byte b : decodedBytes) {
	        tmp.add(b);
	    }
		
		appendTolist(tmp, blockMap.get("HP"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("1"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Thread_Threshold"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Officer_Value"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("3"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Guard_Value"));
        appendTolist(tmp, blockMap.get("Ranged_Attack_Rate"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Melee_Attack_Damage"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Melee_Attack_Rate"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("4"));
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Weapon"));
        tmp.add((byte) 0);
        tmp.add((byte) Integer.parseInt(blockMap.get("Bitflags").replaceAll(" ", ""), 2));
        appendTolist(tmp, blockMap.get("Response_Purse"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Response_Apple"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Response_Beer"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Response_Whistle"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("9"));
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("Ranged_Value"));
        tmp.addAll(convertHexStringToBytes(Data.INSIX));
        appendTolist(tmp, blockMap.get("Mounted_Knight_Value"));
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("10"));
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("11"));
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        tmp.add((byte) 0);
        appendTolist(tmp, blockMap.get("12"));
        tmp.add((byte) 0);
        result.addAll(tmp);
        
	}
	
	private static void appendTolist(List<Byte> list, String s) {
	    try {
	        // Attempt to parse the string as an unsigned integer and then narrow it to a byte.
	        int unsignedInt = Integer.parseUnsignedInt(s);
	        byte result = (byte) unsignedInt; // This narrowing conversion handles the conversion to byte.
	        list.add(result);
	    } catch (NumberFormatException e) {
	        // If parsing as an unsigned int fails, convert each character in the string to a byte.
	        byte[] bytes = s.getBytes();
	        List<Byte> byteList = byteArrayToList(bytes);
	        list.addAll(byteList);
	    }
	}

	private static List<Byte> byteArrayToList(byte[] bytes) {
	    List<Byte> byteList = new ArrayList<>();
	    for (byte b : bytes) {
	        byteList.add(b);
	    }
	    return byteList;
	}
	
	private static Map<String, String> parseBlockToMap(String block) {
        Map<String, String> tagValueMap = new HashMap<>();
        Pattern pattern = Pattern.compile("<(.*?)>(.*?)</\\1>", Pattern.DOTALL);
        Matcher matcher = pattern.matcher(block);

        while (matcher.find()) {
            String tag = matcher.group(1);
            String value = matcher.group(2);
            tagValueMap.put(tag, value);
        }

        return tagValueMap;
    }
	
	private static List<Byte> convertHexStringToBytes(String hexString) {
        // Split the input string into individual hex numbers
        String[] hexNumbers = hexString.split(" ");
        List<Byte> byteList = new ArrayList<>();

        // Convert each hex number to a byte and add to the list
        for (String hexNumber : hexNumbers) {
            int intValue = Integer.parseInt(hexNumber, 16);
            byteList.add((byte) intValue);
        }

        return byteList;
    }
}

